// src/components/MRIForm.js
// src/components/MRIForm.js
import React, { useState } from 'react';
import { useLocation } from 'react-router-dom';
import emailjs from 'emailjs-com';
import '../styles/bookform.css';

const MRIForm = () => {
  const location = useLocation();
  const { service } = location.state || { service: '' };

  const [formData, setFormData] = useState({
    name: '',
    email: '',
    personnummer: '',
    city: '',
    message: '',
    policyConfirmed: false,
    noPacemakerConfirmed: false
  });

  const [error, setError] = useState('');

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData({
      ...formData,
      [name]: type === 'checkbox' ? checked : value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (!formData.policyConfirmed) {
      setError('You must confirm the policy to proceed.');
      return;
    }

    const templateParams = {
      ...formData,
      service: service,
      policyConfirmed: formData.policyConfirmed ? 'Yes' : 'No',
      noPacemakerConfirmed: formData.noPacemakerConfirmed ? 'Yes' : 'No'
    };

    emailjs.send('service_t43b9l3', 'new_template_id', templateParams, 'jpDNG96sg4J956g8G')
      .then((result) => {
        console.log(result.text);
      }, (error) => {
        console.log(error.text);
      });

    // Reset form
    setFormData({
      name: '',
      email: '',
      personnummer: '',
      city: '',
      message: '',
      policyConfirmed: false,
      noPacemakerConfirmed: false
    });

    setError('');
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <h2 className='header-mri'>Kundinformation</h2>
        <div className='text-form-mri-container'><p className='text-form-mri'>Vi använder ditt personnummer för hanteringen av undersökningsinformation och för att hitta din folkbokföringsadress dit vi skickar kallelse och undersökningsresultat.
        Väljer du fakturabetalning skickas din faktura efter ditt besök.</p></div>
        <label>Service:</label>
        <input type="text" name="service" value={service} readOnly />
      </div>
      <div>
        <label>Name:</label>
        <input type="text" name="name" value={formData.name} onChange={handleChange} required />
      </div>
      <div>
        <label>Email:</label>
        <input type="email" name="email" value={formData.email} onChange={handleChange} required />
      </div>
      <div>
        <label>Personnummer <span className='text-form-mri'>ÅÅÅÅMMDDXXXX</span></label>
        <input type="text" name="personnummer" value={formData.personnummer} onChange={handleChange} required />
      </div>
      <div>
      <div>
        <label>Välj plats för undersökning</label>
        <select name="city" value={formData.city} onChange={handleChange} required>
          <option value="">Välj plats</option>
          <option value="Stockholm">Stockholm</option>
          <option value="Gothenburg">Gothenburg</option>
          <option value="Malmö">Malmö</option>
          <option value="Uppsala">Uppsala</option>
          <option value="Västerås">Västerås</option>
          <option value="Örebro">Örebro</option>
          <option value="Linköping">Linköping</option>
          <option value="Helsingborg">Helsingborg</option>
          <option value="Jönköping">Jönköping</option>
          <option value="Norrköping">Norrköping</option>
        </select>
      </div>
        <label>Message:</label>
        <textarea name="message" value={formData.message} onChange={handleChange} required />
      </div>
      <div>
        <label>
          <input type="checkbox" name="noPacemakerConfirmed" checked={formData.noPacemakerConfirmed} onChange={handleChange} required />
          <p className='text-form-mri'>Jag har ingen pacemaker.</p>
        </label>
      </div>
      <div>
        <label>
          <input type="checkbox" name="policyConfirmed" checked={formData.policyConfirmed} onChange={handleChange} required />
          <p className='text-form-mri'>Jag har tagit del av RehabScan integritetspolicy och godkänner villkoren för hur mina personuppgifter lagras samt försäkrar att jag läst köpvillkoren.
       </p> </label>
      </div>
      {error && <div className="error">Du måste intyga att du inte har pacemaker för att gå vidare.</div>}
      <div>
        <button type="submit">Submit</button>
      </div>
    </form>
  );
};

export default MRIForm;
